;; gorilla-repl.fileformat = 1

;; **
;;; # Temporal Analytics
;; **

;; @@
(ns mirthful-shelter
  (:refer-clojure :exclude [find sort])
  (:require [gorilla-plot.core :as plot]
            [gg4clj.core :as gg4clj]
            [monger.collection :as mc]
            [ceres-analytics.core :refer [db news-accounts nodes links]]
            [clojure.data.priority-map :refer [priority-map]]
            [clj-time.core :as t]
            [clj-time.periodic :as p]
            [incanter.stats :refer [mean]]
            [clj-time.format :as f]
            [monger.core :as mg]
            [monger.joda-time]
            [monger.operators :refer :all]
            [aprint.core :refer [aprint]]
            [monger.query :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(let [hour-count (->> {:ts {$gt (t/date-time 2015 3 13 8)
             $lt (t/date-time 2015 3 13 8 59 59 999)}}
       (mc/find-maps @db "pubs")
       (pmap (fn [{:keys [target]}] (reduce + (pmap #(mc/count @db % {:target target
                                                                     :ts {$gt (t/date-time 2015 3 13 8)
             $lt (t/date-time 2015 3 13 8 59 59 999)}}) ["retweets" "replies" "shares"])) ))
       frequencies
       (sort-by val >))
      dat {:degree (map first hour-count)
           :count (map second hour-count)}]
    (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :degree :count]]
       [:geom_line {:stat "identity" :color "steelblue"}]
       [:geom_point {:color "steelblue"}]
       [:xlab "Degree"]
       [:ylab "Count"]
       [:ggtitle "Degree distribution"])]
    {:width 10
     :height 6}))
