(let [hour-count (->> {:ts {$gt (t/date-time 2015 3 13 8)
             $lt (t/date-time 2015 3 13 9 59 59 999)}}
       (mc/find-maps @db "pubs")
       (pmap (fn [{:keys [target]}] (reduce + (pmap #(mc/count @db % {:target target
                                                                     :ts {$gt (t/date-time 2015 3 13 8)
             $lt (t/date-time 2015 3 13 9 59 59 999)}}) ["retweets" "replies" "shares"])) ))
       frequencies
       (sort-by val >))
      dat {:degree (map first hour-count)
           :count (map second hour-count)}]
    (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :degree :count]]
       [:geom_line {:stat "identity" :color "steelblue"}]
       [:geom_point {:color "steelblue"}]
       [:xlab "Degree"]
       [:ylab "Count"]
       [:ggtitle "Degree distribution"])]
    {:width 10
     :height 6}))
